INSERT INTO `Offerta` (`OffertaId`, `tipoOfferta`, `descrizione`) VALUES
(1, 'Promo Speciale', 'Eh crisi intendere padrone ma comune stasera.'),
(2, 'Percentuale', 'Sacro libro albero prossimo risultato movimento essa estate stringere.'),
(3, 'Sconto Fisso', 'Ammazzare passare sonno annunciare dietro strada articolo.'),
(4, 'Sconto Fisso', 'Ambiente autore cultura godere erba parere esso legare ministro numeroso uso domani funzione.'),
(5, 'Sconto Fisso', 'Scappare stanco unire movimento parte esistere levare autore attuale possibilità perfetto labbro facile filo abitare.'),
(6, 'Promo Speciale', 'Piazza dire indicare rivelare orecchio naturalmente stella largo dimostrare.'),
(7, 'Sconto Fisso', 'Strumento oro contrario merito stanco camminare potenza vincere fatto rivolgere brutto massimo fantasia angolo egli spazio.'),
(8, 'Promo Speciale', 'Pieno difesa differenza anno per riunire vino spegnere libro davanti lavoro necessità paese giugno.'),
(9, 'Percentuale', 'Improvviso gioco collo fra ponte disporre prova posto gioco.'),
(10, 'Sconto Fisso', 'Distinguere estremo figurare fretta odore confronto difficoltà fabbrica accogliere amico sposare isola amico.'),
(11, 'Sconto Fisso', 'Voi dinanzi scappare pianura infine accendere consentire.'),
(12, 'Promo Speciale', 'Lira privato gusto reale sangue società giovane finché bello lotta guardia.'),
(13, 'Promo Speciale', 'Gamba diretto pubblico moglie pianta numero si vasto forza voi riunire certamente da.'),
(14, 'Sconto Fisso', 'Ragazzo giardino denaro escludere distanza bere appoggiare lasciare ultimo braccio.'),
(15, 'Percentuale', 'Testa accadere oramai meglio famiglia vario amore.'),
(16, 'Promo Speciale', 'Giocare prima storia comune amare chiamare funzione piantare uccidere salutare.'),
(17, 'Promo Speciale', 'Centrale opera libertà breve lasciare verde accanto albergo bestia dentro considerare famoso destro fra segretario inizio.'),
(18, 'Sconto Fisso', 'Seguito staccare diventare evitare servizio risolvere esistere.'),
(19, 'Promo Speciale', 'Fresco tecnico tirare pianura sforzo grave età.'),
(20, 'Percentuale', 'Male andare sbagliare portare assai pericoloso sistema francese opporre.'),
(21, 'Percentuale', 'Immagine finché stampa costruire puro soffrire sostenere vista rimettere concedere prodotto richiedere rendere.'),
(22, 'Percentuale', 'Operaio sorriso trascinare notizia dio eppure vuoto dentro volgere distruggere tacere annunciare dio buono nazione.'),
(23, 'Sconto Fisso', 'Nazione risultare crescere professore parlare senso mantenere vivo chiave semplice compagno riportare.'),
(24, 'Percentuale', 'Sostenere attaccare mezzo mestiere ridurre provare improvviso nobile maggio primo no.'),
